import React from 'react';
import { Box } from 'grommet';

const landing = props => {
  return (
    <React.Fragment>
      <Box>
        Find places to eat in:
      </Box>
      <Box>
        {props.location}
      </Box>
    </React.Fragment>
  )
}

export default landing;
